import React, { useState, useEffect } from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import { TransitionGroup, Transition } from "react-transition-group";
import styled, { css, ThemeProvider } from "styled-components";
import { themeDark, themeLight } from "themes";
import GlobalStyle, { Device } from "components/globalStyle";
import { Fab } from "components/appBar";
import Home from "views/Home/Home";
import logo from "./amares-l.png";

const Page = styled.div`
    background-image: url("amares.jpg");
    background-size: cover;
    background-position: center;
    position: fixed;
    z-index: 1;
    top: 0;
    left: 0;
    width: 100vw;
    height: 100vh;

    @media ${Device.laptop} {
    }

    @media ${Device.desktop} {
    }
`;

const Header = styled.div`
    display: grid;
    grid-template-columns: auto auto;
    justify-items: center;
    align-items: center;
    justify-content: center;

    img {
        width: 100%;
        max-width: 500px;
        margin: 20px;
    }
`;

type StateProps = {
    readonly state?: string;
};

const Overlay = styled.div<StateProps>`
    position: fixed;
    top: 0;
    z-index: 3;
    inset: 0;
    width: 100vw;
    height: 100vh;
    background: var(--background);
    opacity: 0;
    visibility: hidden;
    transition: 0.3s ease-in-out;

    ${(props) =>
        props.state === "entered" &&
        css`
            opacity: 0.8;
            visibility: visible;
        `};
`;

const Side = styled.aside<StateProps>`
    position: fixed;
    z-index: 4;
    height: 100%;
    width: 100%;
    max-width: 256px;
    display: flex;
    flex-direction: column;
    justify-content: start;
    visibility: hidden;
    opacity: 0;
    top: 0;
    right: -100%;
    transition: 0.25s ease-in;

    @media ${Device.laptop} {
    }

    ${(props) =>
        props.state === "entered" &&
        css`
            visibility: visible;
            opacity: 1;
            right: 0;
            transition: 0.3s ease-out;
            background: var(--primary);
            box-shadow: 0 -3.7px 5.3px rgba(0, 0, 0, 0.028),
                0 -12.5px 17.9px rgba(0, 0, 0, 0.042),
                0 -56px 80px rgba(0, 0, 0, 0.07);
        `};
`;

const Snackbar = styled.div<StateProps>`
    position: fixed;
    z-index: 100;
    left: 0;
    bottom: 0;
    width: 100%;
    min-height: 45px;
    background: var(--on-background);
    color: var(--on-secondary);
    padding: 12px 16px;
    border-radius: 5px;
    box-shadow: 0px 2px 3px rgba(0, 0, 0, 0.3);
    font-size: 13px;
    font-size: 1.3rem;
    line-height: 24px;
    line-height: 2.4rem;
    letter-spacing: 0.1px;
    letter-spacing: 0.01rem;
    font-weight: 400;
    text-transform: inherit;
    visibility: hidden;
    transform: translateY(100%);
    transition: 0.25s ease-in;

    @media ${Device.laptop} {
        width: auto;
        min-width: 344px;
        margin: 28px;
    }

    ${(props) =>
        props.state === "entered" &&
        css`
            visibility: visible;
            transform: translateY(0%);
            transition: 0.3s ease-out;
        `};
`;

const App = function () {
    const nodeRef = React.useRef(null);
    const [sideOpen, setSideOpen] = useState(false);
    const [snackbar, setSnackbar] = useState("");
    const [darkTheme, setDarkTheme] = useState(true);

    useEffect(() => {
        setDarkTheme(true);
    }, []);

    useEffect(() => {
        if (snackbar !== "") {
            setTimeout(function () {
                setSnackbar("");
            }, 5500);
        }
    }, [snackbar]);

    return (
        <Router>
            <ThemeProvider theme={darkTheme ? themeDark : themeLight}>
                <GlobalStyle />
            </ThemeProvider>
            <>
                <Route
                    render={({ location }) => (
                        <Page>
                            <Header>
                                <img src={logo} alt="Logo" />
                                <Fab
                                    type="button"
                                    onClick={() => {
                                        setSideOpen(!sideOpen);
                                    }}
                                >
                                    Encuentranos
                                </Fab>
                            </Header>
                            <TransitionGroup component={null}>
                                <Transition key={location.key} timeout={300}>
                                    {(state) => (
                                        <Switch
                                            key={location.key}
                                            location={location}
                                        >
                                            <Route
                                                exact
                                                path="/"
                                                render={() => (
                                                    <Home state={state} />
                                                )}
                                            />
                                            <Route
                                                path="/turnos"
                                                render={() => <div />}
                                            />
                                        </Switch>
                                    )}
                                </Transition>
                            </TransitionGroup>
                            <Transition
                                nodeRef={nodeRef}
                                in={sideOpen}
                                addEndListener={(nodeRef, done) => {
                                    nodeRef.addEventListener(
                                        "transitionend",
                                        done,
                                        false
                                    );
                                }}
                            >
                                {(state) => (
                                    <>
                                        <Overlay
                                            state={state}
                                            onClick={() => {
                                                setSideOpen(false);
                                            }}
                                        />
                                        <Side state={state}>et</Side>
                                    </>
                                )}
                            </Transition>
                        </Page>
                    )}
                />
                <Transition
                    nodeRef={nodeRef}
                    in={snackbar !== ""}
                    addEndListener={(nodeRef, done) => {
                        nodeRef.addEventListener("transitionend", done, false);
                    }}
                >
                    {(state) => <Snackbar state={state}>{snackbar}</Snackbar>}
                </Transition>
            </>
        </Router>
    );
};

export default App;
